import React from 'react'
import style from './FAQ/faq.module.css'

const FAQ = ({id, title, desc}) => {
  return (
    <article>
        <div>
            <h3> {title} </h3>
            <button>+</button>
        </div>
        <p>
            {desc}
        </p>
    </article>
  )
}

export default FAQ
